import { Route, Switch} from 'react-router';
import Home from './containers/Home';
import Addtocart from "./containers/Home"

const Router = () => {
    return (
        <Switch>
            <Route path="/" element={Home} />
            <Route path="/adtocart" component={Addtocart} />
        </Switch>
    );
};
export default Router;
